package assets

import (
	"pure-game-kit/utility/text"
)

func LoadDefaultAtlasPatterns() (atlasId string, tileIds []string) {
	const symbol = "&"
	var tex = loadTexture(symbol, patterns)
	var id = SetTextureAtlas(tex, 64, 64, 1)
	var ids = []string{}

	for i := range 84 {
		ids = append(ids, symbol+text.New(i))
	}
	var tiles = SetTextureAtlasTiles(id, 0, 0, ids...)
	return id, tiles
}

